export default function Navbar({ role, logout }) {
  return (
    <nav className="bg-white px-6 py-4 shadow-sm flex justify-between items-center">
      <h1 className="text-2xl font-bold text-[color:var(--primary)]">
        FoodDash
      </h1>

      <div className="flex items-center gap-4">
        <span className="bg-[color:var(--primary-soft)]
                         text-[color:var(--primary)]
                         px-4 py-1 rounded-full text-sm font-semibold">
          {role}
        </span>

        <button
          onClick={logout}
          className="text-sm text-gray-500 hover:text-red-500"
        >
          Logout
        </button>
      </div>
    </nav>
  );
}
